import { Box, Button, Dialog, DialogActions, DialogContent, DialogTitle, FormControl, InputLabel, MenuItem, NativeSelect, Select, TextField } from "@material-ui/core"
import { useEffect, useState } from "react";
import axios from 'axios';

interface ClientType{
    _id?:string,
    company_name:string,
}

const Branch = () => {

    useEffect(() => {
        axios.get('api/client/name')
            .then(({data}) => {console.log(data);setClients(data)});
    },[]);

    const [open, setOpen] = useState<boolean>(false);
    const [clients , setClients] = useState<ClientType[]>(null);

    const [age, setAge] = useState<number>(null);
    const handleChange = (event: React.ChangeEvent<{ value: unknown }>) => {};

    const handleClose = () => {
        setOpen(false);
    };

    return (

        <Box m={5}>

            <Button color="primary" variant="outlined" onClick={() => setOpen(true)}>Add Branch</Button>

            <Dialog open={open} onClose={handleClose} aria-labelledby="form-dialog-title">
                <DialogTitle id="form-dialog-title">Add New Branch</DialogTitle>
                <DialogContent>
                    <TextField
                        autoFocus
                        variant="outlined"
                        margin="normal"
                        id="address"
                        label="Address"
                        type="text"
                        fullWidth
                    />
                    <FormControl>
                        <InputLabel id="demo-controlled-open-select-label">Age</InputLabel>
                        <Select
                            labelId="demo-controlled-open-select-label"
                            id="demo-controlled-open-select"
                            open={open}
                            onClose={handleClose}
                            onOpen={handleOpen}
                            value={age}
                            onChange={handleChange}
                        >
                            <MenuItem value="">
                                <em>None</em>
                            </MenuItem>
                            <MenuItem value={10}>Ten</MenuItem>
                            <MenuItem value={20}>Twenty</MenuItem>
                            <MenuItem value={30}>Thirty</MenuItem>
                        </Select>
                    </FormControl>
                </DialogContent>

                <DialogActions>
                    <Button onClick={handleClose} color="primary">
                        Save
                    </Button>
                    <Button onClick={() => setOpen(false)} color="primary">
                        Close
                    </Button>
                </DialogActions>
            </Dialog>

        </Box>
    )
}

export default Branch
